import React from "react";

class DataDisplay extends React.Component {
  render() {
    const { name, email, phone, city } = this.props;
    return (
      <div>
        <p>Name: {name}</p>
        <p>Email: {email}</p>
        <p>Phone: {phone}</p>
        <p>City: {city}</p>
      </div>
    );
  }
}

export default DataDisplay;
